// Function to display workers
function displayWorkers(workers, containerId) {
  const container = document.getElementById(containerId);
  container.innerHTML = "";

  workers.forEach((worker) => {
    const workerCard = document.createElement("div");
    workerCard.classList.add("worker-card");
    workerCard.innerHTML = `
      <img src="${worker.image}" alt="${worker.name}">
      <h3>${worker.name}</h3>
      <p><strong>Category:</strong> ${worker.category}</p>
      <p><strong>Location:</strong> ${worker.location}</p>
      <p><strong>Experience:</strong> ${worker.experience}</p>
      <p><strong>Rating:</strong> ${worker.rating} ⭐</p>
    `;
    container.appendChild(workerCard);
  });
}

// Display featured workers initially
displayWorkers(workers.slice(0, 3), "featuredResults");

// Event listener for search form
document.getElementById("searchForm").addEventListener("submit", (e) => {
  e.preventDefault();
  const location = document.getElementById("location").value.toLowerCase();
  const category = document.getElementById("category").value.toLowerCase();

  const filteredWorkers = workers.filter(
    (worker) =>
      worker.location.toLowerCase().includes(location) &&
      (category === "" || worker.category === category)
  );

  displayWorkers(filteredWorkers, "workerResults");
});
